import Navbar from './components/Navbar';
import './App.css';
import { Routes,Route, BrowserRouter } from 'react-router-dom';
import Home from './components/Home';

function App() {
  return (
    <>
    <div className="App">
     <Navbar/>
     <BrowserRouter></BrowserRouter>
     <Routes>
      <Route path='/home' element={<Home/>}/>
     </Routes>
    </div>
    </>
  );
}

export default App;
